import React from "react";

function Main(props) {
  const containers = ["Top shelf", "Middle shelf", "Lower shelf"];
  return (
    <>
      <sectiontitle>
        <h1>My Fridge</h1>
      </sectiontitle>
      <ul>
        {props.containers.map((container) => (
          <li>{container}</li>
        ))}
      </ul>
    </>
  );
}

const product = (
  <product>
    <h1>Manage me!</h1>
  </product>
);

const recipes = (
  <recipes>
    <h1>Cook me!</h1>
  </recipes>
);

export default Main;
